webpackJsonp([0x7b4af8772c95],{897:function(n,a){n.exports={data:{post:{id:"/Users/jslee/Development/lighthouse-dev.github.io/content/posts/2018-03-10--php-debug/index.md absPath of file >>> MarkdownRemark",html:'<p>PHP デバッグ方法のメモ。</p>\n<p>他のデバッグ方法も今後追記していく予定です。</p>\n<br>\n<h1 id="エラーログをコードに仕込んで出力">エラーログをコードに仕込んで出力</h1>\n<div class="gatsby-code-title gatsby-remark-code-title">sample.php</div>\n<div class="gatsby-highlight">\n      <pre class="language-php"><code class="language-php"><span class="token function">error_log</span><span class="token punctuation">(</span><span class="token function">print_r</span><span class="token punctuation">(</span><span class="token variable">$outputData</span><span class="token punctuation">,</span><span class="token boolean">true</span><span class="token punctuation">)</span><span class="token punctuation">)</span><span class="token punctuation">;</span>\n</code></pre>\n      </div>\n<br>\n<h2 id="任意のファイルに出力">任意のファイルに出力</h2>\n<div class="gatsby-code-title gatsby-remark-code-title">sample.php</div>\n<div class="gatsby-highlight">\n      <pre class="language-php"><code class="language-php"><span class="token function">error_log</span><span class="token punctuation">(</span><span class="token function">print_r</span><span class="token punctuation">(</span><span class="token variable">$outputData</span><span class="token punctuation">,</span><span class="token boolean">true</span><span class="token punctuation">)</span><span class="token punctuation">,</span><span class="token double-quoted-string string">"3"</span><span class="token punctuation">,</span><span class="token double-quoted-string string">"/tmp/debug.log"</span><span class="token punctuation">)</span><span class="token punctuation">;</span>\n</code></pre>\n      </div>\n<ol>\n<li>\n<p><code class="language-text">errer_log</code> 関数の第1引数 -> 出力したい変数/文字列を入れる。</p>\n</li>\n<li>\n<p><code class="language-text">print_r</code> の第2引数 -> <code class="language-text">true</code>を渡すと配列が展開されてログに出力される。</p>\n</li>\n<li>\n<p><code class="language-text">error_log</code>関数の第2引数 -> <code class="language-text">3</code> は、任意のファイルに出力ということ</p>\n</li>\n<li>\n<p><code class="language-text">error_log</code> 関数の第3引数 -> 任意のファイルの出力パス</p>\n</li>\n</ol>',fields:{slug:"/php-debug/",prefix:"2018-03-10"},frontmatter:{title:"PHPデバッグ方法",subTitle:"",cover:{childImageSharp:{resize:{src:"/static/php-logo-5f81f1b2118e564a1010d189809d29f8-160fa.png"}}}}},author:{id:"/Users/jslee/Development/lighthouse-dev.github.io/content/parts/author.md absPath of file >>> MarkdownRemark",html:"<p><strong>jslee</strong> <br>\n福岡在住外国籍WEBエンジニア👋 <br>\nPHPやVue.js、Angularなど書いてます！ 無類のラーメン好き🍜</p>"},footnote:{id:"/Users/jslee/Development/lighthouse-dev.github.io/content/parts/footnote.md absPath of file >>> MarkdownRemark",html:'<ul>\n<li><a href="../">lighthouse.log</a></li>\n</ul>'},site:{siteMetadata:{facebook:{appId:""}}}},pathContext:{slug:"/php-debug/"}}}});
